import Card from "../card/card.component";
import style from "../cards/cards.module.css"

function Cards({ allGames }) {

    const gamesList = Array.isArray(allGames) ? allGames : [];

    return (
        <div className={style.container}>
            {
                gamesList.map((game)=>
                    <Card game={game} />
                )
            }
        </div>
    );
}

export default Cards;
